import { Layout, Row, Col,Divider } from "antd";
const {  Content } = Layout;
function DsNhaBan() {
  return (
    <Layout>
      <Content>
        <Divider orientation="left">Fill rest</Divider>
        <Row>
          <Col flex="100px">100px</Col>
          <Col flex="auto">Fill Rest</Col>
        </Row>
      </Content>
    </Layout>
  );
}

export default DsNhaBan;
